import React from 'react';
import ButtonRandom from './ButtonRandom';

export default function Example() {
    return (
        <div className="px-6 py-10 ring-1 ring-slate-900/5 shadow-xl">
            <h3 className="text-slate-900 mt-5 text-base font-medium">Random Word Generator</h3>
            <div className="text-slate-500 dark:text-slate-400 mt-2 text-xs">
                <div>
                    <p className="display-results">{}</p>
                </div>
                <div className="">
                    <ButtonRandom className="flex relative" />
                </div>
            </div>
        </div>
    )
}
